import React from 'react';
import { BrowserRouter, Router,Route, Routes } from 'react-router-dom';
import './App.css';
import Sidebar from './defultComponent/sidebar';

export default function App() {
  return (
    <><Sidebar />
    <BrowserRouter>
      <Router>
        <Routes>
          <Route path='/' />
          <Route path='/menu' />
        </Routes>
      </Router>
    </BrowserRouter></>
  );
}
